INSERT INTO `tb_cjob` VALUES ('02707dde4cfb4c8aa9070b1bbcbaeece', '20193241048', '瞬联软件科技（北京）有限公司', '瞬联软件科技（北京）有限公司（CIeNET Technologies）成立于2000年5月，是一家符合中国法律的美国独资公司，总\r\n部位于美国伊利诺伊州。我们提供通迅、电信、嵌入式系统和增值业务等领域的软件研发、咨询服务以及技术支持。\r\n\r\n瞬联软件科技是一家具有强大的技术实力和开发能力的科技公司，目前已和多家在通迅电信和嵌入式领域知名的跨国公\r\n司建立了密切的合作关系。我们在中国已经聘用了2000多名优秀工程师及技术骨干在无线通讯系统、高端手机、客户管\r\n理、电信计费、无线网管系统、智能网、娱乐多媒体、邮政设备嵌入式系统和石油开采数据分析等领域内进行项目研\r\n发。\r\n\r\n瞬联软件科技的管理团队成员均具有跨国公司的管理经验。95%以上员工具有本科以上学历，其中70%以上的工程师为硕\r\n士以上学历，也不乏海外归国人员和外籍员工。公司的软件开发流程严格遵循CMMI及ISO质量认证标准。我们不断挖掘工\r\n程管理、规划、实施和系统工程等方面的专业人才，另外还要培养本地化的管理人才和项目带头人。我们的人力资源目\r\n标是聘用、培育并留住中国最具资质的可用人才。\r\n\r\n瞬联软件科技的目标是发展成为一个国际级的软件工厂，为客户开发软件产品或提供解决方案。瞬联软件科技将继续发\r\n扬技术优势及求实、创新的精神，为中国软件行业的发展贡献自己的力量。', 'Java ', '研发部', '5', '7K-12K', '2019-03-23 14:39:00', '武汉 - 洪山区 - 光谷 - 关东科技园 ', '<div class=\"job-detail\">\r\n	<p>\r\n		1、负责CDN相关业务应用平台的开发、维护工作：如CDN内容管理平台，TMS、ACS、NMS等，负责<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553322806215\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553322806215\" rel=\"nofollow\" target=\"_blank\">Java</a>后台需求分析、设计、开发、调试和优化工作；</p>\r\n	<p>\r\n		2、 规范文档的编写、维护，以及其他与项目相关工作；<br />\r\n		3、 负责项目重点、难点的技术攻坚，新技术预研。</p>\r\n	<p>\r\n		要求：</p>\r\n	<p>\r\n		（1）计算机、通信、电子、物理、数学相关专业，本科及以上学历，互联网、通信或者计算机行业工作3年及以上；<br />\r\n		（2）精通 Java 语言，熟练多种 Web 开发框架及部署方式；</p>\r\n	<p>\r\n		（3）熟悉 HTTP相关协议；</p>\r\n	<p>\r\n		（4）熟悉关系数据库或非关系数据库编程；</p>\r\n	<p>\r\n		（5）熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553322806216\" data-lg-tj-content=\"SpringMVC\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-SpringMVC-1553322806216\" rel=\"nofollow\" target=\"_blank\">SpringMVC</a>、Hibernate、Nginx、eclipse、Maven、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553322806216\" data-lg-tj-content=\"Mysql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Mysql-1553322806216\" rel=\"nofollow\" target=\"_blank\">Mysql</a>、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553322806216\" data-lg-tj-content=\"Tomcat\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Tomcat-1553322806216\" rel=\"nofollow\" target=\"_blank\">Tomcat</a>等开源框架和软件；</p>\r\n	<p>\r\n		（6）熟悉 Linux 操作系统的基本操作，熟悉TCP/IP协议，熟练使用常用linux命令；</p>\r\n	<p>\r\n		（7）熟悉 JavaScript, HTML5,Angular JS, Bootstrap,React,React Native更佳；</p>\r\n	<p>\r\n		（8）具备出色的学习、沟通和协调能力，有良好的团队协作意识；</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '3年', '本科', '不做要求', '无', '软件', '不  限', '是', '1', '2019-03-23 14:39:00', '1', '2019-03-23 14:39:00', null, '0');
INSERT INTO `tb_cjob` VALUES ('1eb6b95179da40e994cac1547ad438f5', '20193231045', '金山云', '金山云，金山集团旗下云计算品牌，是全球领先的云计算服务提供商，中国TOP3的云计算公司。\r\n创立于2012年，在北京、上海、成都、广州、香港和北美等全球各地设立数据中心及运营机构。\r\n\r\n金山云已推出云服务器、云物理主机、关系型数据库、缓存、表格数据库、对象存储、负载均\r\n衡、虚拟私有网络、CDN、托管Hadoop、云安全、云解析等在内的完整云产品，以及适用于游\r\n戏、视频、政务、医疗、金融等垂直行业的云服务解决方案。金山云一直进行人工智能的研究和\r\n实践工作，推出的覆盖IaaS、Paas、SaaS、行业解决方案四个层面，适用于各行业的多种组合型\r\nAI解决方案和服务。\r\n\r\n目前，金山云估值已达到23.73亿美元，成为国内估值最高的独立云服务商。未来金山云将一如\r\n既往，为用户提供有竞争力的，安全、可靠、高品质的云计算服务，用云计算将未来提前带到今\r\n天。', 'java开发工程师 ', '研发部', '10', '25K-50K', '2019年03月23日', '北京 - 海淀区 - 小营西路33号 金山软件大厦', '<dl>\r\n	<dd class=\"job-advantage\">\r\n		<span class=\"advantage\">职位诱惑：</span>\r\n		<p>\r\n			免费三餐、弹性工作制、免费班车</p>\r\n	</dd>\r\n	<dd class=\"job_bt\">\r\n		<h3 class=\"description\">\r\n			职位描述：</h3>\r\n		<div class=\"job-detail\">\r\n			<p>\r\n				职责描述：</p>\r\n			<p>\r\n				1. 负责AI相关后端系统的架构设计和开发；</p>\r\n			<p>\r\n				2. 参与人工智能相关业务的需求分析和技术方案输出</p>\r\n			<p>\r\n				任职要求：</p>\r\n			<p>\r\n				1. 计算机及相关专业本科及以上学历；</p>\r\n			<p>\r\n				2. 扎实的计算机系统知识， 对<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553309304253\" data-lg-tj-content=\"数据结构\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E6%95%B0%E6%8D%AE%E7%BB%93%E6%9E%84-1553309304254\" rel=\"nofollow\" target=\"_blank\">数据结构</a>和算法有深刻的理解；</p>\r\n			<p>\r\n				3. 掌握常用<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553309304254\" data-lg-tj-content=\"设计模式\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F-1553309304254\" rel=\"nofollow\" target=\"_blank\">设计模式</a>；深入理解面向对象/函数式编程范式；</p>\r\n			<p>\r\n				3. 精通<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553309304255\" data-lg-tj-content=\"JAVA\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-JAVA-1553309304255\" rel=\"nofollow\" target=\"_blank\">JAVA</a>， 熟练掌握主流开发框架， 具有大型后台系统设计开发经验；</p>\r\n			<p>\r\n				4. 有分布式系统设计经验，掌握微服务和服务治理相关技术，有高并发系统设计经验；</p>\r\n			<p>\r\n				5. 熟悉Kubenetes技术生态，能够基于K8S构建大型后台服务；</p>\r\n			<p>\r\n				6. 性格开朗，具有亲和力，工作积极主动、沟通能力强，具备很好的抗压能力及团队合作精神</p>\r\n		</div>\r\n	</dd>\r\n</dl>\r\n<p>\r\n	&nbsp;</p>\r\n', '3年', '本科', '不做要求', '无', '软件', '不  限', '是', '1', '2019-03-23 11:05:01', '1', '2019-03-23 11:05:01', null, '0');
INSERT INTO `tb_cjob` VALUES ('1fea7746e122491d9b51ac69ff9ecc6a', '20193241056', '阿里巴巴', 'B类事业群是阿里集团最先创立的业务，是全球B类电子商务的领先者和中国最大的B类电子商务企业。\r\n\r\nBU介绍：\r\n\r\n全球速卖通（www.aliexpress.com）创立于2010年4月，是为全球消费者而设的零售市场，其不少用户来自俄罗斯、美国、\r\n西班牙、巴西、法国和英国。世界各地的消费者可以通过全球速卖通，直接以实惠的价格从中国制造商和分销商购买多种\r\n不同的产品。\r\n\r\n农村淘宝cun.taobao.com：是阿里巴巴的三大战略项目之一。为了服务农民，创新农业，让农村变得更美好，阿里巴巴通\r\n过农村淘宝项目，推出“千..', 'java开发工程师 ', '研发部', '50', '15K-30K', '2019-03-23 15:41:18', '杭州 - 滨江区 - 长河 - 网商路699号 ', '<div class=\"job-detail\">\r\n	<p>\r\n		社招：工作3年以上的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553326589538\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553326589538\" rel=\"nofollow\" target=\"_blank\">Java</a>开发</p>\r\n	<p>\r\n		校招：2020年以及以后毕业的在校学生</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '不限', '本科及以上', '不做要求', '无', '软件', '不  限', '是', '1', '2019-03-23 15:41:18', '1', '2019-03-23 15:41:18', null, '0');
INSERT INTO `tb_cjob` VALUES ('295fe28c81644bc6982c7f11f554a050', '20193241054', '平安人寿', '中国平安人寿保险股份有限公司成立于2002年，是中国平安保险（集团）股份有限公司旗下的重要成员。从规模保费来衡\r\n量，是目前国内第二大寿险公司。\r\n\r\n目前，平安人寿在国内共设有41家分公司，超过2800个营业网点，拥有60余万名寿险销售人员，服务网络遍布全国。除了\r\n传统的柜面服务外，平安人寿还搭建了电话、网络、手机WAP、手机APP、移动柜面等多种服务渠道，为客户提供简单、便\r\n捷、高效的金融服务体验。\r\n\r\n秉承“专业 让生活更简单”的品牌理念，平安人寿搭建了个险、银保、电销三大销售渠道，产品体系清晰完整，涵盖了寿\r\n险领域内的普通、分红、万能及投连等各种保险产品，可为客户提供全方位的保障与理财服务，与客户充分分享中国平\r\n安“一个客户、一个帐户、多个产品、一站式服务”的综合金融优势。', 'java开发工程师 ', '研发部', '12', '10K-20K', '2019-03-23 15:16:57', '上海 - 浦东新区 - 唐镇 - 上丰路1288号3号门', '<p>\r\n	工作职责：</p>\r\n<p>\r\n	1、在整个项目生命周期过程中，维护软件程序，根据相关规范处理各种程序变更，修复后续测试中发现程序缺陷，确保软件程序符合系统设计及安全规范要求</p>\r\n<p>\r\n	2、能够指导并带领2-5人的开发团队根据产品团队的设计文档完成系统的公共模块设计、开发</p>\r\n<p>\r\n	3、参与解决系统在开发过程中和实际线上运行过程中遇到各类技术问题</p>\r\n<p>\r\n	4、对所负责的项目或任务的软件程序开发和单元测试，形成规范化的软件代码及相关文档</p>\r\n<p>\r\n	应聘要求：</p>\r\n<p>\r\n	1、本科及以上学历，计算机相关专业，985/211优先；</p>\r\n<p>\r\n	2、工作经验：3年以上工作经验；</p>\r\n<p>\r\n	3、专业技能:</p>\r\n<p>\r\n	（1）熟练使用springboot,springcloud,mybaits,quartz，log4j等相关框架,能够从0开始构建系统设计，包括前期基础代码框搭建，对所使用的框架源码有一定了解；熟悉restful接口；</p>\r\n<p>\r\n	（2）熟悉linux、nginx；熟练掌握常用linux命令；了解系统基础部署架构及相关网络知识；</p>\r\n<p>\r\n	（3）熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553325200698\" data-lg-tj-content=\"mysql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mysql-1553325200698\" rel=\"nofollow\" target=\"_blank\">mysql</a>数据库原理，对关系型数据库表接口设计及sql优化有相应项目经验；熟练使用<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553325200699\" data-lg-tj-content=\"redis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-redis-1553325200699\" rel=\"nofollow\" target=\"_blank\">redis</a>；</p>\r\n<p>\r\n	4、基本能力:思维严谨、工作积极主动、责任心强；沟通能力较好、团队协作能力强；具体一定项目管理经验；</p>\r\n<p>\r\n	5、其他:对技术有浓厚兴趣，对技术问题的学习和处理有较强自驱力</p>\r\n', '1年', '本科', '不做要求', '英语', '软件', '不  限', '是', '1', '2019-03-23 15:16:57', '1', '2019-03-23 15:16:57', null, '0');
INSERT INTO `tb_cjob` VALUES ('352c80cf09724535be9b69fcbd0c106c', '20193231045', '金山云', '新技术,每天在进步\r\n新技术,每天在进步\r\n新技术,每天在进步', 'Java工程师 ', '研发部', '100', '8000-1000元', '2019-04-17 19:28:45', '工作地点', '<dl class=\"job_detail\" id=\"job_detail\">\r\n	<dd class=\"job_bt\">\r\n		<h3 class=\"description\">\r\n			职位描述：</h3>\r\n		<div class=\"job-detail\">\r\n			<p>\r\n				1． 首先，你要热爱coding并乐于学习新鲜事物;</p>\r\n			<p>\r\n				2． 掌握基本的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403286\" data-lg-tj-content=\"数据结构\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E6%95%B0%E6%8D%AE%E7%BB%93%E6%9E%84-1555500403286\" rel=\"nofollow\" target=\"_blank\">数据结构</a>算法;</p>\r\n			<p>\r\n				3． 拥有基础的前端开发能力，会但不限于jquery/boostrap/vue/react等；</p>\r\n			<p>\r\n				4． 熟练使用<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403287\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1555500403287\" rel=\"nofollow\" target=\"_blank\">Java</a>语言，并掌握基本的开发框架：<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403288\" data-lg-tj-content=\"spring\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-spring-1555500403288\" rel=\"nofollow\" target=\"_blank\">spring</a>/springmvc,<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403289\" data-lg-tj-content=\"mybatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mybatis-1555500403289\" rel=\"nofollow\" target=\"_blank\">mybatis</a>等;</p>\r\n			<p>\r\n				5． 至少要掌握两个以上的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403289\" data-lg-tj-content=\"数据库\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E6%95%B0%E6%8D%AE%E5%BA%93-1555500403289\" rel=\"nofollow\" target=\"_blank\">数据库</a>,如mongodb,<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403290\" data-lg-tj-content=\"mysql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mysql-1555500403290\" rel=\"nofollow\" target=\"_blank\">mysql</a>,oracle,<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31555500403290\" data-lg-tj-content=\"redis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-redis-1555500403290\" rel=\"nofollow\" target=\"_blank\">redis</a>等；</p>\r\n			<p>\r\n				6． 掌握基本linux使用命令，懂得linux上的简单运维和部署；</p>\r\n			<p>\r\n				&nbsp;</p>\r\n			<p>\r\n				优先项：</p>\r\n			<p>\r\n				1． 熟悉2，3门以上编程语言，如java,c/c++,python,nodejs,golang等</p>\r\n			<p>\r\n				2． 有过半年以上的实习经验</p>\r\n			<p>\r\n				3． 实践过深度学习项目</p>\r\n			<p>\r\n				4． 有不错的Github开源项目（请附上开源地址）</p>\r\n			<p>\r\n				5． 有消息系统使用经验，如kafka,zeromq,rabbitMQ</p>\r\n		</div>\r\n	</dd>\r\n</dl>\r\n<p>\r\n	&nbsp;</p>\r\n', '不限', '大专以上', '有', '英语', '软件设计', '18-22', '否', '1', '2019-04-17 19:28:15', '1', '2019-04-17 19:28:45', null, '0');
INSERT INTO `tb_cjob` VALUES ('435209dd4b6744f49e6ef91745f67424', '20193241049', '天翼征信有限公司', '天翼征信有限公司于2014年12月成立于上海，集约运营中国电信集团征信业务，是中国电信集团互联网金融板块的重要组\r\n成部分。从成立之初，天翼征信就一直致力于为互联网金融行业提供更好的信用评估和反欺诈服务，为互联网金融的安全\r\n稳定运行保驾护航。', 'java开发工程师 ', '研发部', '12', '6K-12K', '2019-03-23 14:44:47', '上海 - 虹口区 - 四川北路 - 塘沽路463号华虹国际大厦2楼 ', '<div class=\"job-detail\">\r\n	<p>\r\n		职位描述：</p>\r\n	<p>\r\n		1. &nbsp;参与项目需求分析和系统设计 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n	<p>\r\n		2. &nbsp;完成核心/重要模块的设计、编码、测试以及相关文档 &nbsp; &nbsp;&nbsp;</p>\r\n	<p>\r\n		3. &nbsp;参与技术难题攻关，重构系统，保证高性能处理和系统的稳定性</p>\r\n	<p>\r\n		4. &nbsp;协助完成项目的系统集成测试、版本交付等工作&nbsp;</p>\r\n	<p>\r\n		5. &nbsp;维护和升级现有软件产品，快速定位并修复现有软件缺陷</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		任职条件：</p>\r\n	<p>\r\n		1.全日制本科及本科以上，2-3以上 <a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290204\" data-lg-tj-content=\"java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-java-1553323290204\" rel=\"nofollow\" target=\"_blank\">java</a>方面工作经验。</p>\r\n	<p>\r\n		2. &nbsp;具有扎实的JAVA基础</p>\r\n	<p>\r\n		3. &nbsp;熟练运用Spring、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290204\" data-lg-tj-content=\"SpringMVC\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-SpringMVC-1553323290204\" rel=\"nofollow\" target=\"_blank\">SpringMVC</a>、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290204\" data-lg-tj-content=\"MyBatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MyBatis-1553323290204\" rel=\"nofollow\" target=\"_blank\">MyBatis</a>、SOA、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290205\" data-lg-tj-content=\"Dubbo\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Dubbo-1553323290205\" rel=\"nofollow\" target=\"_blank\">Dubbo</a>、REST等服务框架，了解机制</p>\r\n	<p>\r\n		4. &nbsp;具有RPC、分布式、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290205\" data-lg-tj-content=\"多线程\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E5%A4%9A%E7%BA%BF%E7%A8%8B-1553323290205\" rel=\"nofollow\" target=\"_blank\">多线程</a>、cache、MQ、socket通信编程经验</p>\r\n	<p>\r\n		5. &nbsp;熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290205\" data-lg-tj-content=\"Memcache\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Memcache-1553323290205\" rel=\"nofollow\" target=\"_blank\">Memcache</a>/<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290206\" data-lg-tj-content=\"Redis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Redis-1553323290206\" rel=\"nofollow\" target=\"_blank\">Redis</a><a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290206\" data-lg-tj-content=\"缓存\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E7%BC%93%E5%AD%98-1553323290206\" rel=\"nofollow\" target=\"_blank\">缓存</a>、NoSQL、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323290206\" data-lg-tj-content=\"MySQL\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MySQL-1553323290206\" rel=\"nofollow\" target=\"_blank\">MySQL</a>等数据库应用及优化</p>\r\n	<p>\r\n		6. &nbsp;熟悉Zookeeper、Kafka等分布式组件，有hadoop、storm大数据处理及高性能经验优先</p>\r\n	<p>\r\n		7. &nbsp;熟悉Linux，熟悉Linux开发环境、软件环境的搭建与项目的部署</p>\r\n	<p>\r\n		8. &nbsp;工作负有责任，具有良好的沟通能力和学习能力，充满热情、具有团队合作意识</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '1年', '本科', '不做要求', '英语', '软件', '不  限', '是', '1', '2019-03-23 14:44:47', '1', '2019-03-23 14:44:47', null, '0');
INSERT INTO `tb_cjob` VALUES ('6f0e0b195e5c4bb69ea4d590126f6826', '20193241053', '汇电云联', '汇电云联是一家以人工智能与大数据为技术核心的科技型公司，基于电力能源市场为入口，以数据智能驱动，助力发电\r\n企业、售电公司和电力用户在新型电力交易和能源管理方面实现决策智能化、管理智能化。\r\n\r\n \r\n\r\n汇电云联基于云计算和物联网技术实现电力能源数据的采集、清洗、预处理、分析和计算，为用能企业提供智慧用能系\r\n统及服务，促进企业降本增效；基于负荷预测、现货仿真等核心技术，为售电公司与发电企业提供数据分析、风险管\r\n控、交易辅助决策及咨询等服务。\r\n\r\n \r\n\r\n汇电云联拥有一批电力、互联网、数据分析、能源服务等各方面专业素养的国内外专家团队，核心团队在业界均为领军\r\n人才。在国家电力体制改革的影响下聚集在一起，众志成城，致力于电力能源行业数据智能服务，让AI赋能电力市场，\r\n为客户创造最大价值。', 'java开发工程师 ', '研发部', '12', '8K-14K', '2019-03-23 15:09:14', '广州 - 天河区 - 珠江新城 - 马场路16号富力盈盛广场B座', '<div class=\"job-detail\">\r\n	<p>\r\n		1、理解业务需求，编写开发设计方案，并进行程序设计工作；</p>\r\n	<p>\r\n		2、协同技术团队完成项目开发工作，参与代码编写、单元测试、系统集成测试、日常维护与优化等；</p>\r\n	<p>\r\n		3、参与产品需求调研、架构选型设计、数据库设计，并负责具体功能模块的工程设计；</p>\r\n	<p>\r\n		4、完成上级交办的其他工作。</p>\r\n	<p>\r\n		任职资格：</p>\r\n	<p>\r\n		1、本科计算机相关专业毕业，一年以上的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324681361\" data-lg-tj-content=\"JAVA\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-JAVA-1553324681361\" rel=\"nofollow\" target=\"_blank\">JAVA</a>开发工作经验；</p>\r\n	<p>\r\n		2、拥有扎实的JAVA基础知识，理解集合、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324681361\" data-lg-tj-content=\"多线程\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E5%A4%9A%E7%BA%BF%E7%A8%8B-1553324681361\" rel=\"nofollow\" target=\"_blank\">多线程</a>、IO等基础框架；</p>\r\n	<p>\r\n		3、精通JAVA EE相关的主流开源框架，如Struts、Spring、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324681361\" data-lg-tj-content=\"MyBatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MyBatis-1553324681361\" rel=\"nofollow\" target=\"_blank\">MyBatis</a>等，有过springboot、springcloud项目开发经验优先。</p>\r\n	<p>\r\n		4、熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324681362\" data-lg-tj-content=\"MySql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MySql-1553324681362\" rel=\"nofollow\" target=\"_blank\">MySql</a>开发，熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324681365\" data-lg-tj-content=\"Redis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Redis-1553324681365\" rel=\"nofollow\" target=\"_blank\">Redis</a>、Hbase等NoSQL数据库的开发配置；</p>\r\n	<p>\r\n		5、熟悉Linux开发环境，掌握Shell脚本编程；</p>\r\n	<p>\r\n		6、积极主动，拥有良好的沟通能力、责任心、团队精神。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '1年', '本科', '有', '英语', '软件', '不  限', '是', '1', '2019-03-23 15:09:14', '1', '2019-03-23 15:09:14', null, '0');
INSERT INTO `tb_cjob` VALUES ('80392996bcb84a21a932d632a892d2bf', '20193241055', '宇信科技集团', '宇信易诚科技有限公司（以下简称宇信易诚）是中国金融it行业规模有影响力的企业之一。集团总部位于北京，员工人数\r\n超过6000名，已在十余个城市设立了分子公司和代表处，为客户构建了全国性的服务网络。\r\n秉持“专注金融 用心至诚”的企业理念，宇信易诚的业务遍及全国各地，业务类型涵盖咨询服务、软件产品及实施服务、\r\n应用软件开发、运营外包服务、系统集成及增值服务等多个领域，始终保持在网络银行、信贷管理、商业智能、呼叫中\r\n心、风险管理领域的领先地位（最新idc报告）。同时，在客户关系管理、移动金融、前置前端以及系统增值服务等领域也\r\n拥有业界领先的产品并保持着强劲的增长势头。十余年服务于中国金融客户的经验，使宇信易诚积累了丰厚的专业知识和\r\n技术人才资源，并与ibm、hp、oracle、apple等多家国际著名公司结为战略合作伙伴。\r\n公司自2010年起在一直稳居银行业it解决方案服务商前列（idc报告），成为行业的领导者。凭借优异的业绩、在金融行业\r\n的深厚积淀及对行业的深刻理解，宇信易诚连续获得“2012年中国软件和信息服务十大领军企业”、“金软件-银行业软件\r\n典范企业”、“成就十年-2001-2011年中国软件和信息服务领军企业”、“中国经济-***推动力企业”等众多奖项', '初中高级Java工程师（珠海） ', '研发部', '15', '8K-13K', '2019-03-23 15:22:23', '珠海 - 香洲区 - 中国工商银行软件开发中心 ', '<div class=\"job-detail\">\r\n	<p>\r\n		任职要求：</p>\r\n	<p>\r\n		1.最低大专16年毕业，本科17年毕业，计算机相关专业，初中高级<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553325490669\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553325490669\" rel=\"nofollow\" target=\"_blank\">Java</a>都招；</p>\r\n	<p>\r\n		2.熟练掌握JAVA编程语言；</p>\r\n	<p>\r\n		3.熟悉Oracle,<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553325490670\" data-lg-tj-content=\"MySql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MySql-1553325490670\" rel=\"nofollow\" target=\"_blank\">MySql</a>等大型数据库；</p>\r\n	<p>\r\n		4.熟悉springboot、springcloud等微服务架构；</p>\r\n	<p>\r\n		5.有银行相关项目经验优先考虑。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '不限', '大专以上', '不做要求', '英语', '软件', '不  限', '是', '1', '2019-03-23 15:22:23', '1', '2019-03-23 15:22:23', null, '0');
INSERT INTO `tb_cjob` VALUES ('8061cb63e07c40ca8ca615408b8f3a86', '20193241050', '云核网络', '', 'java开发工程师 ', '技术部', '10', '8K-15K', '2019-03-26 14:47:32', '北京 - 海淀区 - 中关村 - 关村五道口 ', '<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	职位描述：</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	1、参与公司核心产品的开发和测试；<br style=\"outline: 0px;\" />\r\n	2、根据开发进度和任务分配，完成相应模块软件的设计、开发、编程任务；<br style=\"outline: 0px;\" />\r\n	3、进行程序单元、功能的测试，查出软件存在的缺陷并保证其质量；<br style=\"outline: 0px;\" />\r\n	4、进行编制项目文档和质量记录的工作；<br style=\"outline: 0px;\" />\r\n	5、维护软件使之保持可用性和稳定性。</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	<br style=\"outline: 0px;\" />\r\n	任职要求：</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	1. 本科或以上学历，计算机软件或相关专业；2年以上工作经验； 2. 扎实的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553582574829\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553582574829\" rel=\"nofollow\" style=\"outline: 0px; color: rgb(0, 179, 138); background-color: transparent; cursor: pointer;\" target=\"_blank\">Java</a>编程基础，熟悉常用的Java开源框架（Spring、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553582574830\" data-lg-tj-content=\"SpringMVC\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-SpringMVC-1553582574830\" rel=\"nofollow\" style=\"outline: 0px; color: rgb(0, 179, 138); background-color: transparent; cursor: pointer;\" target=\"_blank\">SpringMVC</a>、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553582574830\" data-lg-tj-content=\"MyBatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MyBatis-1553582574830\" rel=\"nofollow\" style=\"outline: 0px; color: rgb(0, 179, 138); background-color: transparent; cursor: pointer;\" target=\"_blank\">MyBatis</a>等）；</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	3. 熟悉maven/gradle构建工具</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	4. 熟悉jdk8优先</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	5. 熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553582574830\" data-lg-tj-content=\"MySQL\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MySQL-1553582574830\" rel=\"nofollow\" style=\"outline: 0px; color: rgb(0, 179, 138); background-color: transparent; cursor: pointer;\" target=\"_blank\">MySQL</a>等数据库一种以上，熟练掌握SQL；</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	6. 熟练使用IntelliJ IDEA等软件开发工具，熟悉持续集成；</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	7. 具备良好的识别和设计通用框架及模块的能力；</p>\r\n<p style=\"outline: 0px; margin: 1em 0px; font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, SimSun, Arial, &quot;Helvetica Neue&quot;, Helvetica; white-space: normal;\">\r\n	8. 热爱技术，主动学习，工作认真、严谨，对系统质量意识高，善于沟通与团队协作；</p>\r\n', '不限', '本科及以上', '不做要求', '无', '软件', '28-35', '否', '1', '2019-03-26 14:47:32', '1', '2019-03-26 14:47:32', null, '0');
INSERT INTO `tb_cjob` VALUES ('99ac6c39131a4c91bd2900e34bf6fc4c', '20193241051', '松鼠游戏', '\r\n公司介绍\r\n\r\nShenzhen Songshu Internet Game Co.,深圳松鼠游戏网络信息有限公司（以下简称“松鼠游戏”）是一家专注移动游戏\r\n联合运营、独代发行及海外发行的新锐游戏公司。\r\n\r\n松鼠游戏成立于2016年，创始员工均来自国内一线企业专业管理人才。\r\n\r\n坚持以精品为核心，以数据为导向，本着“乐享自游”的企业宗旨，致力为玩家打造最优质的游戏产品。\r\n\r\n松鼠游戏的宗旨是“合作共赢”，倡导开放、平等的工作环境、富有激情并且充满创意的工作气氛，全力为玩家提供更\r\n高品质、更好玩的游戏', 'java开发工程师 ', '研发部', '7', '8K-15K', '2019-03-23 14:56:41', '深圳 - 南山区 - 科技园 - 高新园北区朗山路源政创业大厦B座801 ', '<div class=\"job-detail\">\r\n	<p>\r\n		岗位职责：</p>\r\n	<p>\r\n		1.&nbsp;参与需求分析、文档设计、编码调试等软件相关工作；</p>\r\n	<p>\r\n		2.&nbsp;根据研发项目安排，按时按质完成项目研发工作&nbsp;；</p>\r\n	<p>\r\n		3.&nbsp;维护现有项目并作出优化。</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		任职要求：</p>\r\n	<p>\r\n		1、2年以上工作经验，本科或以上学历；</p>\r\n	<p>\r\n		2、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323939850\" data-lg-tj-content=\"java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-java-1553323939850\" rel=\"nofollow\" target=\"_blank\">java</a>基础扎实，熟悉<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323939851\" data-lg-tj-content=\"数据结构\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E6%95%B0%E6%8D%AE%E7%BB%93%E6%9E%84-1553323939851\" rel=\"nofollow\" target=\"_blank\">数据结构</a>，及常用的<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323939852\" data-lg-tj-content=\"设计模式\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F-1553323939852\" rel=\"nofollow\" target=\"_blank\">设计模式</a>；</p>\r\n	<p>\r\n		3、有ssm，springboot ,springcloud经验；</p>\r\n	<p>\r\n		4、熟练掌握Oracle、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323939852\" data-lg-tj-content=\"MySQL\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-MySQL-1553323939852\" rel=\"nofollow\" target=\"_blank\">MySQL</a>等数据库；</p>\r\n	<p>\r\n		5、熟悉常用的linux命令；</p>\r\n	<p>\r\n		6、熟悉常用的jquery、bootstrap等前端技术；</p>\r\n	<p>\r\n		7、责任心强，做事细心、具备良好的团队合作精神和承受压力的能力。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '1年', '本科', '有', '英语', '软件', '不  限', '否', '1', '2019-03-23 14:56:41', '1', '2019-03-23 14:56:41', null, '0');
INSERT INTO `tb_cjob` VALUES ('c1fb26bba9414f1cb5895a5ee11b82b0', '20193241052', '邦盛科技证券产品中心', '浙江邦盛科技有限公司(简称邦盛科技)，成立于2010年，总部位于中国杭州，是国内最早专注于金融领域实时反欺诈与\r\n授信的国家高新技术企业。服务行业涵盖银行、第三方支付、互联网金融、证券保险、OTA、电商等，是中国金融实时风\r\n控行业领军者。 \r\n\r\n邦盛科技核心团队来自美国道富、阿里巴巴、IBM、华为、浙江大学等。管理团队长期服务于美国道富(全球最大的托管\r\n银行)，并与美国多家著名金融机构深度合作10余年，具备丰富的金融行业信息系统建设经验和全球化视野。目前公司有\r\n近300员工，核心研发人员中，90%为硕士或博士学历。\r\n\r\n公司具备独立自主的大数据技术研发能力，在流式计算、实时计算、复杂事件处理、机器学习、数据挖掘等技术领域拥\r\n有国内顶尖技术团队。邦盛科技与浙江大学建立了战略合作关系，浙大强大的技术支撑和源源不断的人才支持，确保邦\r\n盛技术始终保持领先水平。\r\n\r\n邦盛科技成功研发了拥有自主品牌的大数据实时急速处理技术“流立方”，该技术集群吞吐量高达176万笔/秒，延时最\r\n短可控1毫秒内，技术能力处于国际领先水平，是邦盛开展事中反欺诈业务的技术基础，可在毫秒级进行复杂计算、并行\r\n计算、实时关联分析，帮助企业做出更有价值的实时决策。\r\n\r\n邦盛科技专注于中央风控与实时风控市场，并逐步向泛金融领域扩展，自主研发了一整套金融领域实时风险控制与反欺\r\n诈产品，针对100多个金融风险场景，建立了2400多个规则与模型，形成了国内金融实时风控领域最全的规则模型库，拥\r\n有全行业最全的欺诈信息数据库。\r\n\r\n领先的产品、数据与技术壁垒，让邦盛科技备受顶尖投资机构的青睐，截止目前，邦盛已获得两轮共计数亿元融资，投\r\n资方包括绿盟科技、君联资本、新湖控股、达晨创投和魔量创投等。\r\n\r\n邦盛科技在发展中一直秉承“引领科技、追求卓越、昌盛国邦”的价值观，通过领先世界的科技技术，保障我国金融基\r\n础设施安全。\r\n\r\n邦盛优势\r\n\r\n◎  领先的技术创新能力\r\n\r\n独立研发的核心技术“流立方”是业界领先的流式大数据实时处理平台，技术水平在国际上遥遥领先；科研型的机器学\r\n习研发团队，机器学习技术保持全国领先。\r\n\r\n◎  丰富的风控业务与模型\r\n\r\n    100多个风险场景，2400多个规则与模型，形成国内金融实时风控领域最全的规则模型库。\r\n\r\n◎  超强的数据规模\r\n\r\n    组建互联网金融欺诈信息共享联盟，共享欺诈信息近亿条，构建全行业最全的欺诈信息数据库。', 'Java研发工程师 ', '研发部', '12', '8K-12K', '2019-03-23 15:03:03', '杭州 - 西湖区 - 天堂软件园D幢17楼', '<p>\r\n	岗位职责：</p>\r\n<p>\r\n	1、配合项目经理完成项目的需求分析和详细设计；</p>\r\n<p>\r\n	2、根据相关的规范和客户的要求，撰写相关的技术文档；</p>\r\n<p>\r\n	3、负责软件模块的设计、核心代码的编写，以及单元测试、集成测试等。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	任职要求：</p>\r\n<p>\r\n	1、计算机相关专业，本科及以上学历，两年管理后台开发经验；</p>\r\n<p>\r\n	2、精通extjs，并使用extjs做过项目开发；</p>\r\n<p>\r\n	3、熟练使用spring、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324302216\" data-lg-tj-content=\"mybatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mybatis-1553324302216\" rel=\"nofollow\" target=\"_blank\">mybatis</a>、spring-boot等开发框架和技术。使用过spring-boot开发过项目的优先；</p>\r\n<p>\r\n	4、精通<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324302216\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553324302216\" rel=\"nofollow\" target=\"_blank\">Java</a>编程，熟练使用J2EE<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324302217\" data-lg-tj-content=\"设计模式\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F-1553324302217\" rel=\"nofollow\" target=\"_blank\">设计模式</a>；</p>\r\n<p>\r\n	5、熟悉使用oracle、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553324302217\" data-lg-tj-content=\"mysql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mysql-1553324302217\" rel=\"nofollow\" target=\"_blank\">mysql</a>等大型数据库，并至少使用过一种中间件；</p>\r\n<p>\r\n	6、熟悉常用的linux系统命令；</p>\r\n<p>\r\n	7、有银行或金融项目经验更佳</p>\r\n', '1年', '本科', '不做要求', '英语', '软件', '不  限', '是', '1', '2019-03-23 15:03:03', '1', '2019-03-23 15:03:03', null, '0');
INSERT INTO `tb_cjob` VALUES ('d1853fed26b74672be33585d20d02a7a', '20193241046', '快手', ' 在快手上，用户可以用短视频和照片记录生活点滴，也可以通过直播与他人实时互动。快手的\r\n视频内容覆盖生活的方方面面，用户遍布全球各地。作为线下真实生活在网络上的全息投射，快\r\n手平台汇聚了完整的中国社会生活图景，被誉为流动的清明上河图。\r\n\r\n       快手坚持每个人都值得被记录的理念，让中国最广大的人群能够留下属于自己的影像记\r\n录。在这里，每个人能够迅速找到自己感兴趣的人和喜欢的内容，看到更大更真实有趣的世界，\r\n也让世界看到自己。人们在这里记录，在这里连接，在这里消解孤独，在这里生长幸福。\r\n\r\n       快手是用户导向、技术驱动的公司。快手APP受用户喜爱的背后，是团队在计算机视觉、\r\n人工智能等技术领域的多年深耕。快手用技术理解用户，同时理解视频内容，用算法实现内容和\r\n用户的个性化匹配，为用户推送符合每个人兴趣爱好并适当拓展兴趣空间的内容。', 'java开发工程师 ', '研发部', '30', '25K-50K', '2019年03月23日', '北京 - 海淀区 - 中关村 - 关村五道口 ', '<dl>\r\n	<dd class=\"job_bt\">\r\n		<div class=\"job-detail\">\r\n			<p>\r\n				工作职责</p>\r\n			<p>\r\n				1、负责高性能广告交易平台的设计、研发及持续优化；&nbsp;</p>\r\n			<p>\r\n				2、负责广告营销平台后端、结算系统和DMP系统开发及持续优化；&nbsp;</p>\r\n			<p>\r\n				3、与广告算法团队一起，研发和优化广告召回、排序、竞价、频率/流量控制等核心投放策略；&nbsp;</p>\r\n			<p>\r\n				4、对现有系统的不足进行分析,找到目前系统的瓶颈,改进提高系统性能；&nbsp;</p>\r\n			<p>\r\n				5、参与解决海量商业数据分布式处理、高效查询、数据一致性、准确性等方面带来的各种技术难题和挑战。&nbsp;</p>\r\n			<p>\r\n				&nbsp;</p>\r\n			<p>\r\n				任职资格：</p>\r\n			<ol class=\"list-paddingleft-2\">\r\n				<li>\r\n					<p>\r\n						计算机或相关专业本科以上学历，具备1年以上的大型Web应用开发和架构经验；</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						熟悉linux开发环境，熟练使用<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553320017290\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553320017291\" rel=\"nofollow\" target=\"_blank\">Java</a>和面向对象设计开发；</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						熟悉主流Web应用相关的框架，对至少两个主流框架有深入理解；</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						对<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553320017292\" data-lg-tj-content=\"设计模式\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F-1553320017292\" rel=\"nofollow\" target=\"_blank\">设计模式</a>、软件工程等有较深入的理解；</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						熟悉大型分布式、高并发、高可用性系统设计开发；</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						了解统计模型，有机器学习，数据挖掘等相关技术工作经验的优先;</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						有过大规模（千万级在线用户以上）AdExchange，DSP系统开发经验的优先;&nbsp;</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						有创业者基因：你渴望一个能够共同成长的团队，而不是找一份养家糊口的工作;&nbsp;</p>\r\n				</li>\r\n				<li>\r\n					<p>\r\n						有开发高品质产品、编写高质量代码的自我要求.</p>\r\n				</li>\r\n			</ol>\r\n		</div>\r\n	</dd>\r\n</dl>\r\n<p>\r\n	&nbsp;</p>\r\n', '3年', '本科', '不做要求', '英语', '软件', '不  限', '是', '1', '2019-03-23 13:56:34', '1', '2019-03-23 13:56:34', null, '0');
INSERT INTO `tb_cjob` VALUES ('e1c1960b54434e628a87050ea5c97001', '20193241050', '云核网络', '北京云核网络技术有限公司（简称：云核网络CloudCore）成立于2013年，由业内广泛应用的PE平台设计团队、VX平台设计\r\n团队、安全产品团队、经验丰富的电子银行实施团队联合创建。是一家专业的、具有一定规模性的金融科技（FINTECH）公\r\n司。公司技术团队全部拥有丰富的金融业软件开发实施经验，本科及以上学历占90%，平均年龄不足30岁，是一支朝气蓬\r\n勃、积极向上、敢想敢拼的年轻团队。公司团队凭借着丰富的银行业业务经验专注于银行业软硬件产品的研发，成立至今\r\n已拥有多项软件产品著作权及专利权。公司拥有广泛且稳定的银行业客户基础，覆盖全国大部分国有银行、外资银行、城\r\n市商业银行、农村商业银行等。随着公司业务的不断拓展需要新鲜的血液融入我们的团队，如果你是一个积极努力却无处\r\n施展的年轻人，那么欢迎你的加入！', 'java开发工程师', '研发部', '14', '6K-12K', '2019-03-23 14:50:15', '太原 - 小店区 - 坞城 - 体育路科技街口KK派对后面的晋城银行太原研发中心 ', '<p>\r\n	岗位职责：<br />\r\n	<br />\r\n	1、负责公司产品软件功能模块的详细设计、开发、测试。<br />\r\n	<br />\r\n	2、参与系统的需求调研和需求分析。<br />\r\n	<br />\r\n	3、参与撰写需求分析说明书、概要设计、详细设计等相关技术文档。<br />\r\n	<br />\r\n	4、根据公司的设计和编码规范能独立完成分配模块的设计、编码、测试工作。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	任职要求：<br />\r\n	<br />\r\n	1、本科及以上学历，计算机科学与技术、软件工程等相关专业；<br />\r\n	<br />\r\n	2、精通<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591366\" data-lg-tj-content=\"Java\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Java-1553323591366\" rel=\"nofollow\" target=\"_blank\">Java</a>语言，对<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591366\" data-lg-tj-content=\"设计模式\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-%E8%AE%BE%E8%AE%A1%E6%A8%A1%E5%BC%8F-1553323591366\" rel=\"nofollow\" target=\"_blank\">设计模式</a>有一定了解；<br />\r\n	<br />\r\n	3、熟悉J2EE规范，熟悉Spring、Spring&nbsp;Boot、Spring&nbsp;Clound、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591367\" data-lg-tj-content=\"Dubbo\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Dubbo-1553323591367\" rel=\"nofollow\" target=\"_blank\">Dubbo</a>、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591367\" data-lg-tj-content=\"Mybatis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Mybatis-1553323591367\" rel=\"nofollow\" target=\"_blank\">Mybatis</a>、Hibernate、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591368\" data-lg-tj-content=\"Redis\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-Redis-1553323591368\" rel=\"nofollow\" target=\"_blank\">Redis</a>、Zookeeper、Kafka等框架者优先；<br />\r\n	<br />\r\n	4、熟悉Oracle、<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553323591369\" data-lg-tj-content=\"mysql\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-mysql-1553323591369\" rel=\"nofollow\" target=\"_blank\">mysql</a>、DB2等主流数据库，精通sql语言者优先；<br />\r\n	<br />\r\n	5、熟悉angular、vue、react、jquery、typescript、nodejs、webpack等框架者优先<br />\r\n	<br />\r\n	6、熟练使用SVN、GIT、Linux命令者优先<br />\r\n	<br />\r\n	7、具有良好的文档编写能力者优先；<br />\r\n	<br />\r\n	8、具有良好的团队合作能力、性格开朗、善于沟通；<br />\r\n	<br />\r\n	9、具有金融行业经验者优先；<br />\r\n	<br />\r\n	10、能够短期出差者优先。</p>\r\n', '1年', '本科', '无', '英语', '软件', '不  限', '是', '1', '2019-03-23 14:50:15', '1', '2019-03-23 14:50:15', null, '0');
INSERT INTO `tb_cjob` VALUES ('ee65979336614679b2bcfa88614a0f53', '20193241047', '伊智软件', '伊智软件成立于2015年，专注于为服务行业提供软件技术与互联网化服务。\r\n公司拥有百人的强大技术研发团队，自主研发了三位一体的美业SaaS软件，从门店运营管理到员工、顾客全方位覆盖，并\r\n持续更新推动美业经营升级。\r\n伊智结合了伊的家十年来在自媒体营销、活动策划、广告视频、品牌宣传、运营推广等多维度的经验赋能给美业门店，引\r\n领行业潮流。\r\n伊智在纽约、多伦多、温哥华等城市设立分公司运营，引领当地美业潮流新风尚', '高级java开发工程师 ', '研发部', '10', '8000-1000元', '2019-03-23 14:31:30', '广州 - 天河区 - 广州市天河区珠江新城金穗路3号汇美大厦1502', '<div class=\"job-detail\">\r\n	<p>\r\n		岗位职责：</p>\r\n	<p>\r\n		1.与产品经理协同配合，参与需求定义，确定设计方案并负责带领团队最终实现；</p>\r\n	<p>\r\n		2.带领团队，承担关键任务攻关；保证所负责系统的稳定性、高性能、可扩展性；</p>\r\n	<p>\r\n		3.以结果为导向，推动项目顺利进行，并对结果负责；</p>\r\n	<p>\r\n		4.促进团队共同进步；</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		任职要求：</p>\r\n	<p>\r\n		1.4年以上<a class=\"jd-ad\" data-ad=\"3\" data-lg-tj-cid=\"31553322272734\" data-lg-tj-content=\"JAVA\" data-lg-tj-id=\"1kcw\" data-lg-tj-no=\"idnull\" href=\"https://kaiwu.lagou.com/course/courseInfo.htm?courseId=1&amp;sid=3-JAVA-1553322272734\" rel=\"nofollow\" target=\"_blank\">JAVA</a>开发经验，2年以上项目团队管理经验；</p>\r\n	<p>\r\n		2.对业务分析、领域建模有着丰富的实践；</p>\r\n	<p>\r\n		3.有强烈的责任心，优秀的表达能力及沟通能力，较强的学习和理解能力，思路清晰，善于思考，能独立分析和解决问题。</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		我们将为您提供：</p>\r\n	<p>\r\n		0、终身快速科学上网服务（全球各地有SS节点）</p>\r\n	<p>\r\n		1、薪资：我们提供行业内有竞争力的薪酬；（BTW: 试用期是 100%薪资）</p>\r\n	<p>\r\n		2、奖金+提成：优秀的您可以共享公司的经营业绩，直接每月兑现公司总销售利润；</p>\r\n	<p>\r\n		3、基本保障福利：公司按照国家规定为员工缴纳五险一金；</p>\r\n	<p>\r\n		4、额外补充福利：</p>\r\n	<p>\r\n		* 晋升加薪类：每年有超过行业平均的加薪幅度；</p>\r\n	<p>\r\n		* 礼金礼品类: 过节费、各类礼金等；</p>\r\n	<p>\r\n		* 员工关怀类: &ldquo;家人生日会&ldquo;(程序猿/媛的生日可以更加丰富多彩的）</p>\r\n	<p>\r\n		* 团队建设类：团队月度&ldquo;腐败&rdquo;活动</p>\r\n	<p>\r\n		* 年度旅游+自由度大+提升空间大+快速成长期</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', '3年', '本科', '不做要求', '英语', '软件', '18-22', '是', '1', '2019-03-23 14:31:30', '1', '2019-03-23 14:31:30', null, '0');
