INSERT INTO `tb_company` VALUES ('2a225879ea814037971111d2d69414b3', '20193241050', '241050', '云核网络', '123456789@qq.com', '12365478952', '移动互联网 ', '国有企业', '150-500人 ', '太原', '北京云核网络技术有限公司（简称：云核网络CloudCore）成立于2013年，由业内广泛应用的PE平\r\n台设计团队、VX平台设计团队、安全产品团队、经验丰富的电子银行实施团队联合创建。是一家专\r\n业的、具有一定规模性的金融科技（FINTECH）公司。公司技术团队全部拥有丰富的金融业软件开\r\n发实施经验，本科及以上学历占90%，平均年龄不足30岁，是一支朝气蓬勃、积极向上、敢想敢拼\r\n的年轻团队。公司团队凭借着丰富的银行业业务经验专注于银行业软硬件产品的研发，成立至今已\r\n拥有多项软件产品著作权及专利权。公司拥有广泛且稳定的银行业客户基础，覆盖全国大部分国有\r\n银行、外资银行、城市商业银行、农村商业银行等。随着公司业务的不断拓展需要新鲜的血液融入\r\n我们的团队，如果你是一个积极努力却无处施展的年轻人，那么欢迎你的加入！', '1', '2019-03-23 14:47:36', '1', '2019-03-23 14:48:46', null, '0');
INSERT INTO `tb_company` VALUES ('39fe935fb342425482d7ff103ac04a1b', '20193231045', '231045', '金云山', '123456789@qq.com', '12354678965', '移动互联网,数据服务', '国有企业', '500-2000人', '北京 - 海淀区 - 小营西路33号 金山软件大厦', '金山云，金山集团旗下云计算品牌，是全球领先的云计算服\r\n务提供商，中国TOP3的云计算公司。创立于2012年，在北\r\n京、上海、成都、广州、香港和北美等全球各地设立数据中\r\n心及运营机构。\r\n\r\n金山云已推出云服务器、云物理主机、关系型数据库、缓\r\n存、表格数据库、对象存储、负载均衡、虚拟私有网络、\r\nCDN、托管Hadoop、云安全、云解析等在内的完整云产品，\r\n以及适用于游戏、视频、政务、医疗、金融等垂直行业的云\r\n服务解决方案。金山云一直进行人工智能的研究和实践工\r\n作，推出的覆盖IaaS、Paas、SaaS、行业解决方案四个层\r\n面，适用于各行业的多种组合型AI解决方案和服务。\r\n\r\n目前，金山云估值已达到23.73亿美元，成为国内估值最高\r\n的独立云服务商。未来金山云将一如既往，为用户提供有竞\r\n争力的，安全、可靠、高品质的云计算服务，用云计算将未\r\n来提前带到今天。', '1', '2019-03-23 10:52:21', '1', '2019-04-18 17:55:57', null, '0');
INSERT INTO `tb_company` VALUES ('5286f3f6ea574e0197dcfea8e9a700e4', '20193241047', '241047', '伊智软件', '123456789@qq.com', '12365478541', '移动互联网 生活服务', '民营', ' 2000人以上 ', ' 广州', '伊智软件成立于2015年，专注于为服务行业提供软件技术与互联网化服务。\r\n\r\n公司拥有百人的强大技术研发团队，自主研发了三位一体的美业SaaS软件，从门店运营管理到员\r\n工、顾客全方位覆盖，并持续更新推动美业经营升级。\r\n伊智结合了伊的家十年来在自媒体营销、活动策划、广告视频、品牌宣传、运营推广等多维度的经\r\n验赋能给美业门店，引领行业潮流。\r\n伊智在纽约、多伦多、温哥华等城市设立分公司运营，引领当地美业潮流新风尚。', '1', '2019-03-23 14:26:20', '1', '2019-03-23 14:28:56', null, '0');
INSERT INTO `tb_company` VALUES ('59fe5fc4ea394e29ad1f1ee1022796ee', '20193241052', '241052', '邦盛科技证券产品中心', '123456789@qq.com', '12365478965', '信息安全,金融 ', '国有企业', '150-500人 ', '杭州', '浙江邦盛科技有限公司(简称邦盛科技)，成立于2010年，总部位于中国杭州，是国内最早专注于\r\n金融领域实时反欺诈与授信的国家高新技术企业。服务行业涵盖银行、第三方支付、互联网金\r\n融、证券保险、OTA、电商等，是中国金融实时风控行业领军者。 \r\n\r\n邦盛科技核心团队来自美国道富、阿里巴巴、IBM、华为、浙江大学等。管理团队长期服务于美\r\n国道富(全球最大的托管银行)，并与美国多家著名金融机构深度合作10余年，具备丰富的金融行\r\n业信息系统建设经验和全球化视野。目前公司有近300员工，核心研发人员中，90%为硕士或博士\r\n学历。\r\n\r\n公司具备独立自主的大数据技术研发能力，在流式计算、实时计算、复杂事件处理、机器学习、\r\n数据挖掘等技术领域拥有国内顶尖技术团队。邦盛科技与浙江大学建立了战略合作关系，浙大强\r\n大的技术支撑和源源不断的人才支持，确保邦盛技术始终保持领先水平。\r\n\r\n邦盛科技成功研发了拥有自主品牌的大数据实时急速处理技术“流立方”，该技术集群吞吐量高\r\n达176万笔/秒，延时最短可控1毫秒内，技术能力处于国际领先水平，是邦盛开展事中反欺诈业\r\n务的技术基础，可在毫秒级进行复杂计算、并行计算、实时关联分析，帮助企业做出更有价值的\r\n实时决策。\r\n\r\n邦盛科技专注于中央风控与实时风控市场，并逐步向泛金融领域扩展，自主研发了一整套金融领\r\n域实时风险控制与反欺诈产品，针对100多个金融风险场景，建立了2400多个规则与模型，形成\r\n了国内金融实时风控领域最全的规则模型库，拥有全行业最全的欺诈信息数据库。\r\n\r\n领先的产品、数据与技术壁垒，让邦盛科技备受顶尖投资机构的青睐，截止目前，邦盛已获得两\r\n轮共计数亿元融资，投资方包括绿盟科技、君联资本、新湖控股、达晨创投和魔量创投等。\r\n\r\n邦盛科技在发展中一直秉承“引领科技、追求卓越、昌盛国邦”的价值观，通过领先世界的科技\r\n技术，保障我国金融基础设施安全。\r\n\r\n邦盛优势\r\n\r\n◎  领先的技术创新能力\r\n\r\n独立研发的核心技术“流立方”是业界领先的流式大数据实时处理平台，技术水平在国际上遥遥\r\n领先；科研型的机器学习研发团队，机器学习技术保持全国领先。\r\n\r\n◎  丰富的风控业务与模型\r\n\r\n    100多个风险场景，2400多个规则与模型，形成国内金融实时风控领域最全的规则模型库。\r\n\r\n◎  超强的数据规模\r\n\r\n    组建互联网金融欺诈信息共享联盟，共享欺诈信息近亿条，构建全行业最全的欺诈信息数据\r\n库。', '1', '2019-03-23 15:00:03', '1', '2019-03-23 15:01:10', null, '0');
INSERT INTO `tb_company` VALUES ('7805244b6dd94dd1a4fcad429cab3489', '20193241056', '241056', '阿里巴巴', '123456789@qq.com', '12365478965', ' 移动互联网,电子商务', ' 上市公司 ', '2000人以上', '杭州', 'B类事业群是阿里集团最先创立的业务，是全球B类电子商务的领先者和中国最大的B类电子商务\r\n企业。\r\n\r\nBU介绍：\r\n\r\n全球速卖通（www.aliexpress.com）创立于2010年4月，是为全球消费者而设的零售市场，其不\r\n少用户来自俄罗斯、美国、西班牙、巴西、法国和英国。世界各地的消费者可以通过全球速卖\r\n通，直接以实惠的价格从中国制造商和分销商购买多种不同的产品。\r\n\r\n\r\n农村淘宝cun.taobao.com：是阿里巴巴的三大战略项目之一。为了服务农民，创新农业，让农村\r\n变得更美好，阿里巴巴通过农村淘宝项目，推出“千县万村计划”，计划在三至五年内投资100\r\n亿元，建立1000个县级服务中心和10万个村级服务站。\r\n\r\n\r\n国际事业部 www.alibaba.com ：1999年推出Alibaba.com平台。Alibaba.com是全球最大的跨境\r\nB2B平台，平台注册的全球采购商数量超过5000万。（注册会员数量超过6000万，其中以买家或\r\n者买卖Both身份注册的，超过5000万家）每天有来自全球超过200个国家（地区）的中小企业，\r\n在Alibaba.com平台上进行采购。每天有近30万笔的询盘订单在alibaba.com平台上发生。2015年\r\n3月，Alibaba.com面向全球中小企业采购商，推出了基于大数据的TradeAssurance服务（TA，信\r\n用保障服务），在全球范围内创造性的实现了跨境贸易的交易在线化。我们有机会基于TA交易体\r\n系，构建全球中小企业的信用体系，形成中国中小企业在全球贸易中的又一核心竞争力。\r\n\r\n\r\nCBU事业部：CBU事业部-1688.com是最大的内贸B2B平台。2014年交易规模突破2000亿人民币（在\r\n线交易额），占整个内贸B2B电子商务平台交易量的50%以上。每天有超过1500万的买家来到\r\n1688.com平台，每天有近40万的买家进行实际的批发采购，每天有近100万笔的B类订单在平台上\r\n产生。 从2014年开始，1688推出全球货源平台，发展B2B进口业务主打全球优选、各国特色、海\r\n量货源，覆盖大量的线下B类批发零售商家，还覆盖了40%以上的淘宝和天猫商家，商家可以在平\r\n台上完成一站式进货，同时消费者也能享受到更多优质低价的进口好货。', '1', '2019-03-23 15:37:36', '1', '2019-03-23 15:39:26', null, '0');
INSERT INTO `tb_company` VALUES ('88abdafdeab14bd6af0dcfcf782516c3', '20193241053', '241053', '汇电云联', '123456789@qq.com', '12365478569', '移动互联网', '国有企业', '50-150人', '广州', '关于企业\r\n\r\n \r\n\r\n汇电云联是一家以人工智能与大数据为技术核心的科技型公司，基于电力能源市场为入口，以数\r\n据智能驱动，助力发电企业、售电公司和电力用户在新型电力交易和能源管理方面实现决策智能\r\n化、管理智能化。\r\n\r\n \r\n\r\n汇电云联基于云计算和物联网技术实现电力能源数据的采集、清洗、预处理、分析和计算，为用\r\n能企业提供智慧用能系统及服务，促进企业降本增效；基于负荷预测、现货仿真等核心技术，为\r\n售电公司与发电企业提供数据分析、风险管控、交易辅助决策及咨询等服务。\r\n\r\n \r\n\r\n汇电云联拥有一批电力、互联网、数据分析、能源服务等各方面专业素养的国内外专家团队，核\r\n心团队在业界均为领军人才。在国家电力体制改革的影响下聚集在一起，众志成城，致力于电力\r\n能源行业数据智能服务，让AI赋能电力市场，为客户创造最大价值。\r\n\r\n \r\n\r\n公司官网：www.huidiancloud.com\r\n\r\n总部地址：广州市天河区珠江新城马场路16号富力盈盛广场B座\r\n\r\n公司公众号：汇电云联        公司小程序：汇电查查\r\n\r\n\r\n企业愿景：成为电力能源行业领先的数据智能服务企业\r\n\r\n企业使命：让AI赋能电力市场，为客户创造最大价值\r\n\r\n核心价值：专注、创新、进取\r\n\r\n产品理念：精准识别需求 锤炼优质产品\r\n\r\n\r\n我们的福利：\r\n\r\n \r\n\r\n1、 朝九晚六，周末双休，加班调休，五险一金\r\n\r\n2、 带薪假期：公司为员工提供各类法定节假日和带薪年假，以及其他福利假期\r\n\r\n3、 绩效奖金：根据公司经营状况，结合绩效考核成绩发放奖金\r\n\r\n4、 额外奖励：公司设有内部推荐人才奖、优秀员工奖等各种奖励\r\n\r\n5、 贴心关怀：\r\n\r\n节日福利小礼品，轻松下午茶\r\n\r\n业余时间娱乐活动，轰趴，篮球，羽毛球活动\r\n\r\n年度福利体检，为你的身体健康做出保驾护航\r\n\r\n每年7月-10月份发放高温补贴\r\n\r\n公司急救药箱为突感不适、不慎受伤的员工提供了安全保护伞\r\n\r\n茶水间配备电冰箱、微波炉等方便员工日常生活\r\n\r\n6、 晋升机会：公司为员工提供了公平、公正、公开的横向及纵向晋升通道', '1', '2019-03-23 15:06:15', '1', '2019-03-23 15:07:46', null, '0');
INSERT INTO `tb_company` VALUES ('b78cac5ded2241c4acc159608b1a9cf3', '20193241055', '241055', '宇信科技集团', '123456789@qq.com', '12547898745', '金融 ', '上市公司 ', '2000人以上 ', '珠海', '宇信易诚科技有限公司（以下简称宇信易诚）是中国金融it行业规模有影响力的企业之一。集团\r\n总部位于北京，员工人数超过6000名，已在十余个城市设立了分子公司和代表处，为客户构建了\r\n全国性的服务网络。\r\n秉持“专注金融 用心至诚”的企业理念，宇信易诚的业务遍及全国各地，业务类型涵盖咨询服\r\n务、软件产品及实施服务、应用软件开发、运营外包服务、系统集成及增值服务等多个领域，始\r\n终保持在网络银行、信贷管理、商业智能、呼叫中心、风险管理领域的领先地位（最新idc报\r\n告）。同时，在客户关系管理、移动金融、前置前端以及系统增值服务等领域也拥有业界领先的\r\n产品并保持着强劲的增长势头。十余年服务于中国金融客户的经验，使宇信易诚积累了丰厚的专\r\n业知识和技术人才资源，并与ibm、hp、oracle、apple等多家国际著名公司结为战略合作伙伴。\r\n公司自2010年起在一直稳居银行业it解决方案服务商前列（idc报告），成为行业的领导者。凭\r\n借优异的业绩、在金融行业的深厚积淀及对行业的深刻理解，宇信易诚连续获得“2012年中国软\r\n件和信息服务十大领军企业”、“金软件-银行业软件典范企业”、“成就十年-2001-2011年中\r\n国软件和信息服务领军企业”、“中国经济-***推动力企业”等众多奖项', '1', '2019-03-23 15:19:16', '1', '2019-03-23 15:20:27', null, '0');
INSERT INTO `tb_company` VALUES ('bf827a50f4b649e1bb78fb49b033e816', '20193241054', '241054', '平安人寿', '123456789@qq.com', '12365478965', '金融 ', '上市公司 ', ' 2000人以上', '上海', '中国平安人寿保险股份有限公司成立于2002年，是中国平安保险（集团）股份有限公司旗下的重\r\n要成员。从规模保费来衡量，是目前国内第二大寿险公司。\r\n\r\n目前，平安人寿在国内共设有41家分公司，超过2800个营业网点，拥有60余万名寿险销售人员，\r\n服务网络遍布全国。除了传统的柜面服务外，平安人寿还搭建了电话、网络、手机WAP、手机\r\nAPP、移动柜面等多种服务渠道，为客户提供简单、便捷、高效的金融服务体验。\r\n\r\n秉承“专业 让生活更简单”的品牌理念，平安人寿搭建了个险、银保、电销三大销售渠道，产\r\n品体系清晰完整，涵盖了寿险领域内的普通、分红、万能及投连等各种保险产品，可为客户提供\r\n全方位的保障与理财服务，与客户充分分享中国平安“一个客户、一个帐户、多个产品、一站式\r\n服务”的综合金融优势。\r\n\r\n平安人寿拥有完善的治理架构和专业的管理团队，不断推动管理变革和科技创新，保持和增强了\r\n在销售、精算、产品、品牌、培训、后援及IT等诸多领域的优势地位，也为公司和客户创造了持\r\n续增长的价值：首开国内个人寿险营销和MIT移动展业平台之先河；开通第一家全国集成的呼叫\r\n中心95511；首创一年一度的客户服务节活动；率先在业内推出国内/海外急难援助服务；打造以\r\n客户为中心的两核集中运营平台和一站式理赔绿色通道服务；成为国内首家通过国家级保险服务\r\n业标准化试点项目验收的寿险公司等。', '1', '2019-03-23 15:14:16', '1', '2019-03-23 15:15:30', null, '0');
INSERT INTO `tb_company` VALUES ('d53de535db254f59ab205c00f1ac3358', '20193241049', '241049', '天翼征信有限公司', '123456789@qq.com', '36985214787', '电子商务,移动互联网 ', '国有企业', ' 50-150人 ', '上海', '天翼征信有限公司于2014年12月成立于上海，集约运营中国电信集团征信业务，是中国电信集团互\r\n联网金融板块的重要组成部分。从成立之初，天翼征信就一直致力于为互联网金融行业提供更好的\r\n信用评估和反欺诈服务，为互联网金融的安全稳定运行保驾护航。', '1', '2019-03-23 14:41:59', '1', '2019-03-23 14:43:09', null, '0');
INSERT INTO `tb_company` VALUES ('e3077360b51845c8a6d1972dce0b210e', '20193241051', '241051', '松鼠游戏', '123456789@qq.com', '12547896321', ' 游戏 ', '民营', '50-150人 ', '深圳', 'Shenzhen Songshu Internet Game Co.,深圳松鼠游戏网络信息有限公司（以下简称“松鼠游\r\n戏”）是一家专注移动游戏联合运营、独代发行及海外发行的新锐游戏公司。\r\n\r\n松鼠游戏成立于2016年，创始员工均来自国内一线企业专业管理人才。\r\n\r\n坚持以精品为核心，以数据为导向，本着“乐享自游”的企业宗旨，致力为玩家打造最优质的游戏\r\n产品。\r\n\r\n松鼠游戏的宗旨是“合作共赢”，倡导开放、平等的工作环境、富有激情并且充满创意的工作气\r\n氛，全力为玩家提供更高品质、更好玩的游戏。', '1', '2019-03-23 14:53:11', '1', '2019-03-23 14:54:52', null, '0');
INSERT INTO `tb_company` VALUES ('eaa506452801471fb510308c315eaad9', '20193241048', '241048', '瞬联软件科技（北京）有限公司', '11111111@qq.com', '12365478951', '移动互联网 ,企业服务 ', '国有企业', '500-2000人', '', '瞬联软件科技（北京）有限公司（CIeNET Technologies）成立于2000年5月，是一家符合中国法\r\n律的美国独资公司，总部位于美国伊利诺伊州。我们提供通迅、电信、嵌入式系统和增值业务等\r\n领域的软件研发、咨询服务以及技术支持。\r\n\r\n瞬联软件科技是一家具有强大的技术实力和开发能力的科技公司，目前已和多家在通迅电信和嵌\r\n入式领域知名的跨国公司建立了密切的合作关系。我们在中国已经聘用了2000多名优秀工程师及\r\n技术骨干在无线通讯系统、高端手机、客户管理、电信计费、无线网管系统、智能网、娱乐多媒\r\n体、邮政设备嵌入式系统和石油开采数据分析等领域内进行项目研发。\r\n\r\n瞬联软件科技的管理团队成员均具有跨国公司的管理经验。95%以上员工具有本科以上学历，其\r\n中70%以上的工程师为硕士以上学历，也不乏海外归国人员和外籍员工。公司的软件开发流程严\r\n格遵循CMMI及ISO质量认证标准。我们不断挖掘工程管理、规划、实施和系统工程等方面的专业\r\n人才，另外还要培养本地化的管理人才和项目带头人。我们的人力资源目标是聘用、培育并留住\r\n中国最具资质的可用人才。\r\n\r\n瞬联软件科技的目标是发展成为一个国际级的软件工厂，为客户开发软件产品或提供解决方案。\r\n瞬联软件科技将继续发扬技术优势及求实、创新的精神，为中国软件行业的发展贡献自己的力\r\n量。', '1', '2019-03-23 14:34:27', '1', '2019-04-18 17:53:36', null, '0');
INSERT INTO `tb_sob` VALUES ('5f97b622b517493ea338b3312b19d58f', '20193231549', '高级java开发工程师 ', '25K-50K', '上海', '我对现有工作还算满意，如有更好的工作机会，我也可以考虑(到岗时间另议)', null, null, '3456', '百度搜索中心', '移动互联网 ', '算法工程师', '开发人员', '15K', '负责JETech(亚马逊欧洲站，排名前十的零售品牌）新产品从上线到成熟整个过程管理。 \r\n1.协助产品上线：确定新产品后，监督并协助产品包装，说明书确定，确认到货时间，亚马逊图片生成。 \r\n2.监督产品上线：利用平台资源进行产品数据的收集，分析，确保规划和制定产品策略顺利执行，解决过程中出现的问\r\n题。协助新产品上架，确保推广，文字，图片，相应信息，确保达到销售目标的达成。 \r\n3.产品上线后的维护：跟进新品，定期反馈数据分析报告，监控及管理产品的评价数据，做好产品生命周期的跟进及维\r\n护。收集市场上公司各产品主要竞争对手的资料信息，生成分析报告，改变销售策略。 \r\n4.业务培训：负责员工业务知识的学习，培训其岗位业务知		\r\n						\r\n						\r\n						', '2015.3 - 2016.5', '深圳某服装ERP公司手持设备应用软件开发', '2018.6-2018.9', '																					\r\n						\r\n						\r\n						', '<p>\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">1. 收集客户的业务需求,进行深入的需求分析、需求设计、需求跟踪，与现有产品的需求差异分析，输出面向技术设计人员的需求说明文档；&nbsp;</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">2.协调开发资源，掌控开发进度；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">3.开发完成后，初步测试验证版本。待内测完成后，提交客户测试验收；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">4.与客户沟通版本问题，收集问题提交研发处理直至最终发布正式版本；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">5.编写用户的操作使用手册并给客户产品培训。</span></p>\r\n', '深圳某服装ERP公司手持设备应用软件开发', '北京大学', '2012.9 - 2016.6', '软件工程', '是', '研究生', '2012.9-2013.6', '甲骨文培训机构', 'WEB+Python', '英语', null, null, '优秀员工', '2019-03-13', '<p>\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">我性格热情随和，细心稳重，抗压能力强。勤于思考，对事有自己一定的见解，能比较迅速接受新事物，有一定的自学能力。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">两年的工作经历不仅让我在组织能力、策划能力和团队意识上有了提高，如何最大限度的将自身融入团队中，也让我学会如何协调工作、学习和生活，更让我懂得何谓责任与担当。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">希望能努力工作为贵公司的发展创造出自己的价值。</span></p>\r\n', '1', '2019-03-24 20:49:47', '1', '2019-04-18 19:45:38', null, '0');
INSERT INTO `tb_sob` VALUES ('95c6e5e20d564471ae323c6231c68ed4', '20193231548', 'java开发工程师 ', '6K-12K', '上海', '我目前处于离职状态，可立即上岗', null, null, '软件', '阿里搜索中心', '移动互联网,数据服务', '算法工程师', '开发人员', '15K', '公司介绍： \r\n大疆公司是大疆无人机的创造者，拥有了世界领先的无人机技术。 \r\n工作内容： \r\n1、基于ARM平台雷达信号处理，包括FFT以及数字滤波等算法的实现，该工作为前期验证方案阶段。 \r\n2、为实现厘米级测距精度，基于ARM平台移植Chirp-Z频谱细化算法。 \r\n3、ARM平台相关驱动的编写，CAN UART SPI以及FreertOS操作系统。				\r\n						\r\n						\r\n						', '2015.3 - 2016.5', '百度算法', '2018.6-2018.9', '														\r\n						\r\n				11111111111111111111111111111111		', '<p>\r\n	<span class=\"field-value-span\">1、各部门招聘岗位收集，招聘需求分析，编制成招聘需求文档。<br />\r\n	2、执行上级安排的招聘任务，甄选各渠道求职者投递的简历。<br />\r\n	3、招聘岗位发布，简历筛选，预约，组织安排初试，初试反馈，复试及规范招聘流程等相关工作。<br />\r\n	4、采用网络，现场，微博，HR群，内部介绍，校企合作等渠道进行招聘</span></p>\r\n', '百度', '南京大学', '2012.9 - 2016.6', '软件这几', '是', '本科', '', '', '', '英语', null, null, '优秀员工', '2017-01-04', '<p>\r\n	<span class=\"field-value-span\">1、熟悉行政工作的各项流程和工作事项。<br />\r\n	2、有较强的沟通能力和应变能力，并有很强的团队合作精神。<br />\r\n	3、多次组织公司内部活动，有较强的组织协调能力。<br />\r\n	4、性格开朗，为人真诚谦虚，能吃苦耐劳。工作积极进取，尽职尽责。</span></p>\r\n', '1', '2019-03-23 16:47:34', '1', '2019-04-17 19:50:20', null, '0');
INSERT INTO `tb_sob` VALUES ('d5b7bf22fa55449598f2770f9fd03485', '20193231550', '高级java开发工程师 ', '25K-50K', '上海', '我对现有工作还算满意，如有更好的工作机会，我也可以考虑(到岗时间另议)', null, null, '软件', '百度搜索中心', '移动互联网 ', '算法工程师', '开发人员', '15K', '负责JETech(亚马逊欧洲站，排名前十的零售品牌）新产品从上线到成熟整个过程管理。 \r\n1.协助产品上线：确定新产品后，监督并协助产品包装，说明书确定，确认到货时间，亚马逊图片生成。 \r\n2.监督产品上线：利用平台资源进行产品数据的收集，分析，确保规划和制定产品策略顺利执行，解决过程中出现的问\r\n题。协助新产品上架，确保推广，文字，图片，相应信息，确保达到销售目标的达成。 \r\n3.产品上线后的维护：跟进新品，定期反馈数据分析报告，监控及管理产品的评价数据，做好产品生命周期的跟进及维\r\n护。收集市场上公司各产品主要竞争对手的资料信息，生成分析报告，改变销售策略。 \r\n4.业务培训：负责员工业务知识的学习，培训其岗位业务知		\r\n						', '2015.3 - 2016.5', '深圳某服装ERP公司手持设备应用软件开发', '2018.6-2018.9', '1.根据UI给出的界面，进行切图并实现页面布局。\r\n2.利用javascript以及css3实现页面交互效果\r\n3.通过后台接口，实现页面与后台数据的交互。\r\n4.处理前端的一些业务流程		', '<p>\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">1. 收集客户的业务需求,进行深入的需求分析、需求设计、需求跟踪，与现有产品的需求差异分析，输出面向技术设计人员的需求说明文档；&nbsp;</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">2.协调开发资源，掌控开发进度；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">3.开发完成后，初步测试验证版本。待内测完成后，提交客户测试验收；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">4.与客户沟通版本问题，收集问题提交研发处理直至最终发布正式版本；</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">5.编写用户的操作使用手册并给客户产品培训。</span></p>\r\n', '深圳某服装ERP公司手持设备应用软件开发', '北京大学', '2012.9 - 2016.6', '软件工程', '是', '研究生', '2012.9-2013.6', '甲骨文培训机构', 'WEB+Python', '英语', 'on', 'on', '优秀员工', '2019-03-13', '<p>\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">我性格热情随和，细心稳重，抗压能力强。勤于思考，对事有自己一定的见解，能比较迅速接受新事物，有一定的自学能力。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">两年的工作经历不仅让我在组织能力、策划能力和团队意识上有了提高，如何最大限度的将自身融入团队中，也让我学会如何协调工作、学习和生活，更让我懂得何谓责任与担当。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">希望能努力工作为贵公司的发展创造出自己的价值。</span></p>\r\n', '1', '2019-03-24 21:04:21', '1', '2019-03-24 21:04:21', null, '0');
INSERT INTO `tb_sobz` VALUES ('0d52a35145674a2290580d73fe78bbd9', '20193231548', '20193241054', '295fe28c81644bc6982c7f11f554a050', '软件', 'java开发工程师 ', '6K-12K', '上海', '我目前处于离职状态，可立即上岗', null, null, null, '百度搜索中心', '移动互联网,数据服务', '算法工程师', '开发人员', '15K', '公司介绍： \r\n大疆公司是大疆无人机的创造者，拥有了世界领先的无人机技术。 \r\n工作内容： \r\n1、基于ARM平台雷达信号处理，包括FFT以及数字滤波等算法的实现，该工作为前期验证方案阶段。 \r\n2、为实现厘米级测距精度，基于ARM平台移植Chirp-Z频谱细化算法。 \r\n3、ARM平台相关驱动的编写，CAN UART SPI以及FreertOS操作系统。				\r\n						', '2015.3 - 2016.5', '百度算法', '2018.6-2018.9', null, '<p>\r\n	<span class=\"field-value-span\">1、各部门招聘岗位收集，招聘需求分析，编制成招聘需求文档。<br />\r\n	2、执行上级安排的招聘任务，甄选各渠道求职者投递的简历。<br />\r\n	3、招聘岗位发布，简历筛选，预约，组织安排初试，初试反馈，复试及规范招聘流程等相关工作。<br />\r\n	4、采用网络，现场，微博，HR群，内部介绍，校企合作等渠道进行招聘</span></p>\r\n', '百度', '南京大学', '2012.9 - 2016.6', '软件这几', '是', '本科', '', '', '', '英语', 'on', 'on', '优秀员工', '2017-01-04', '<p>\r\n	<span class=\"field-value-span\">1、熟悉行政工作的各项流程和工作事项。<br />\r\n	2、有较强的沟通能力和应变能力，并有很强的团队合作精神。<br />\r\n	3、多次组织公司内部活动，有较强的组织协调能力。<br />\r\n	4、性格开朗，为人真诚谦虚，能吃苦耐劳。工作积极进取，尽职尽责。</span></p>\r\n', '1', '2019-03-24 12:21:25', '1', '2019-03-24 12:21:25', null, '0');
