INSERT INTO `tb_sobz` VALUES ('34637eedc4db4d53b94656719da25920', '20193231549', '20193241055', '80392996bcb84a21a932d632a892d2bf', '软件', '高级java开发工程师 ', '25K-50K', '上海', '我对现有工作还算满意，如有更好的工作机会，我也可以考虑(到岗时间另议)', null, null, null, '百度搜索中心', '移动互联网 ', '算法工程师', '开发人员', '15K', '负责JETech(亚马逊欧洲站，排名前十的零售品牌）新产品从上线到成熟整个过程管理。 \r\n1.协助产品上线：确定新产品后，监督并协助产品包装，说明书确定，确认到货时间，亚马逊图片生成。 \r\n2.监督产品上线：利用平台资源进行产品数据的收集，分析，确保规划和制定产品策略顺利执行，解决过程中出现的问\r\n题。协助新产品上架，确保推广，文字，图片，相应信息，确保达到销售目标的达成。 \r\n3.产品上线后的维护：跟进新品，定期反馈数据分析报告，监控及管理产品的评价数据，做好产品生命周期的跟进及维\r\n护。收集市场上公司各产品主要竞争对手的资料信息，生成分析报告，改变销售策略。 \r\n4.业务培训：负责员工业务知识的学习，培训其岗位业务知		', '2015.3 - 2016.5', '深圳某服装ERP公司手持设备应用软件开发', '2018.6-2018.9', null, '<p>\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">1. 收集客户的业务需求,进行深入的需求分析、需求设计、需求跟踪，与现有产品的需求差异分析，输出面向技术设计人员的需求说明文档；&nbsp;</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">2.协调开发资源，掌控开发进度；</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">3.开发完成后，初步测试验证版本。待内测完成后，提交客户测试验收；</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">4.与客户沟通版本问题，收集问题提交研发处理直至最终发布正式版本；</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">5.编写用户的操作使用手册并给客户产品培训。</span></p>\r\n', '深圳某服装ERP公司手持设备应用软件开发', '北京大学', '2012.9 - 2016.6', '软件工程', '是', '研究生', '2012.9-2013.6', '甲骨文培训机构', 'WEB+Python', '英语', '熟练', '熟练', '优秀员工', '2019-03-13', '<p>\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">我性格热情随和，细心稳重，抗压能力强。勤于思考，对事有自己一定的见解，能比较迅速接受新事物，有一定的自学能力。</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">两年的工作经历不仅让我在组织能力、策划能力和团队意识上有了提高，如何最大限度的将自身融入团队中，也让我学会如何协调工作、学习和生活，更让我懂得何谓责任与担当。</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">希望能努力工作为贵公司的发展创造出自己的价值。</span></p>\r\n', '1', '2019-03-24 20:53:54', '1', '2019-03-24 20:53:54', null, '0');
