工', '2019-03-13', '<p>\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">我性格热情随和，细心稳重，抗压能力强。勤于思考，对事有自己一定的见解，能比较迅速接受新事物，有一定的自学能力。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">两年的工作经历不仅让我在组织能力、策划能力和团队意识上有了提高，如何最大限度的将自身融入团队中，也让我学会如何协调工作、学习和生活，更让我懂得何谓责任与担当。</span><br font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\" />\r\n	<span font-size:=\"\" helvetica=\"\" pingfang=\"\" style=\"font-family: \" white-space:=\"\">希望能努力工作为贵公司的发展创造出自己的价值。</span></p>\r\n', '1', '2019-03-24 21:05:12', '1', '2019-03-24 21:05:12', null, '0');
