研发处理直至最终发布正式版本；</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">5.编写用户的操作使用手册并给客户产品培训。</span></p>\r\n', '深圳某服装ERP公司手持设备应用软件开发', '北京大学', '2012.9 - 2016.6', '软件工程', '是', '研究生', '2012.9-2013.6', '甲骨文培训机构', 'WEB+Python', '英语', '熟练', '熟练', '优秀员工', '2019-03-13', '<p>\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">我性格热情随和，细心稳重，抗压能力强。勤于思考，对事有自己一定的见解，能比较迅速接受新事物，有一定的自学能力。</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">两年的工作经历不仅让我在组织能力、策划能力和团队意识上有了提高，如何最大限度的将自身融入团队中，也让我学会如何协调工作、学习和生活，更让我懂得何谓责任与担当。</span><br style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\" />\r\n	<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 16px; white-space: normal;\">希望能努力工作为贵公司的发展创造出自己的价值。</span></p>\r\n', '1', '2019-03-24 20:58:43', '1', '2019-03-24 20:58:43', null, '0');
INSERT INTO `tb_sobz` VALUES ('554e44f1b08645c0a51d14172f6b099d', '20193231548', '20193241056', '1fea7746e122491d9b51ac69ff9ecc6a', '软件', 'java开发工程师 ', '6K-12K', '上海', '我目前处于离职状态，可立即上岗', null, null, null, '百度搜索中心', '移动互联网,数据服务', '算法工程师', '开发人员', '15K', '公司介绍： \r\n大疆公司是大疆无人机的创造者，拥有了世界领先的无人机技术。 \r\n工作内容： \r\n1、基于ARM平台雷达信号处理，包括FFT以及数字滤波等算法的实现，该工作为前期验证方案阶段。 \r\n2、为实现厘米级测距精度，基于ARM平台移植Chirp-Z频谱细化算法。 \r\n3、ARM平台相关驱动的编写，CAN UART SPI以及FreertOS操作系统。				\r\n						', '2015.3 - 2016.5', '百度算法', '2018.6-2018.9', null, '<p>\r\n	<span class=\"field-value-span\">1、各部门招聘岗位收集，招聘需求分析，编制成招聘需求文档。<br />\r\n	2、执行上级安排的招聘任务，甄选各渠道求职者投递的简历。<br />\r\n	3、招聘岗位发布，简历筛选，预约，组织安排初试，初试反馈，复试及规范招聘流程等相关工作。<br />\r\n	4、采用网络，现场，微博，HR群，内部介绍，校企合作等渠道进行招聘</span></p>\r\n', '百度', '南京大学', '2012.9 - 2016.6', '软件这几', '是', '本科', '', '', '', '英语', 'on', 'on', '优秀员工', '2017-01-04', '<p>\r\n	<span class=\"field-value-span\">1、熟悉行政工作的各项流程和工作事项。<br />\r\n	2、有较强的沟通能力和应变能力，并有很强的团队合作精神。<br />\r\n	3、多次组织公司内部活动，有较强的组织协调能力。<br />\r\n	4、性格开朗，为人真诚谦虚，能吃苦耐劳。工作积极进取，尽职尽责。</span></p>\r\n', '1', '2019-03-24 14:38:35', '1', '2019-03-24 14:38:35', null, '0');
